import React from 'react';
import myPhoto from './imgs/me.jpg';

const AboutMe = () => {
  return (
    <div>
      <h1>About Me</h1>
      <img src={myPhoto} alt="My Photo" />
      <p>This is a brief description about me.</p>
    </div>
  );
};

export default AboutMe;
